var theme = getTheme();
var isErrorPage = isErrorUrl(document.location.href);
var isSettingsPage = isSettingsUrl(document.location.href);
var themeSwitcher, themeNamer;
run();

function run() {
    if (window.top == window || isErrorPage) {
        if (document.location.href.indexOf('/live_chat') != -1) {
            addCss("theme", chatCss);
        } else if (document.location.href.indexOf('youtube') != -1 && document.location.href.indexOf('youtube.com/embed') == -1) {
            applyFull(!isErrorPage);
            if (!isErrorPage) {
                addCss("buttons", buttonStyling);
            }
        }
    } else if (document.referrer.indexOf('youtube') != -1) {
        if (theme == "Dark") {
            if (document.location.href.indexOf('https://plus.google.com') == 0 && document.location.href.indexOf('/notifications/frame') != -1) {
                addCss("theme", noticesCss);
            } else if (document.location.href.indexOf('/live_chat') != -1) {
                addCss("theme", chatCss);
            } else if (document.getElementById('player') == null) {
                if (document.location.href.indexOf('https://plus.google.com/_/up/widget') == 0 && document.location.href.indexOf('parent=https%3A%2F%2Fwww.youtube.com') != -1) {
                    addCss("theme", googlePlusCss);
                } else if (document.location.href.indexOf('https://apis.google.com') == 0 && document.location.href.indexOf('hovercard/internalcard') != -1) {
                    addCss("theme", hoverCardCss);
                } else if (document.location.href.indexOf('subscribe_embed') != -1) {
                    addCss("theme", subEmbedCss);
                }
            }
        }
    }
}

function htmlToDom(html) {
    var dom = document.createElement('DIV');
    dom.innerHTML = html;
    html = dom.firstChild;
    return html;
}

function addToSettings() {
    if (isSettingsPage) {
        var sections = document.getElementsByClassName('account-content');
        if (sections && sections.length) {
            section = sections[0].getElementsByClassName('account-section');
            if (!(section && section.length)) {
                section = htmlToDom('<div class="account-section"></div>');
                sections[0].appendChild(section);
            } else {
                section = section[0];
            }
            var created = htmlToDom('\
<div class="account-info-item">\
    <span class="account-info-label">Current Theme</span>\
    <div class="account-info account-user-info">\
       <span class="theme">' + theme + '</span> (<a>Switch</a>)\
    </div>\
</div>');
            section.appendChild(created);
            themeNamer = created.getElementsByClassName('theme')[0];
            created = created.getElementsByTagName('A')[0].onclick = function() {
                updateState(theme == "Dark" ? 1 : 0);
            };
        }
    }
}

function addToFooter() {
    var footer = document.getElementById('google-help');
    if (footer) {
        var link = document.createElement('A');
        link.setAttribute('class', 'yt-uix-button footer-history yt-uix-button-default yt-uix-button-size-default');
        link.innerHTML = 'Toggle Theme';
        link.onclick = function() {
            updateState(theme == "Dark" ? 1 : 0);
        };
        footer.parentNode.insertBefore(link, footer);
    }
}

function applyFull(addButtons) {
    addCss("main", buttonStyle);
    
    if (addButtons) {
        var options = document.createElement('DIV');
        themeSwitcher = createButton();
        themeSwitcher.innerHTML = "<span class='yt-uix-button-content' > Switch Theme (" + theme + ")</span>";
        themeSwitcher.onclick = function() {
            updateState(theme == "Dark" ? 1 : 0);
        };
        options.appendChild(themeSwitcher);
        document.ready = function() {
            var container = document.createElement('DIV');
            container.id = "DT_settingspanel";
            container.appendChild(options);
            document.body.appendChild(container);
            addToSettings();
            addToFooter();
        }
    }
    
    if (theme == "Dark") {
        switchToDark();
    } else {
        setTheme("Light");
    }

    window.onready = function() {
        $(window).focus(function() {
            var them = getTheme();
            if (them != theme) {
                updateState(them == "Dark" ? 0 : 1);
            }
        });
    }
}

function updateState(mode) {
    if (mode == 1) {
        switchToLight();
    } else {
        switchToDark();
    }
    reloadComments();
    themeSwitcher.innerHTML = "<span class='yt-uix-button-content' > Switch Theme (" + theme + ")</span>";
    if (themeNamer) themeNamer.innerHTML = theme;
}

function switchToDark() {
    addCss("theme", mainCss + subEmbedCss + nonIframeCommentsCss);
    setTheme("Dark");
}

function switchToLight() {
    removeCss("theme");
    setTheme("Light");
}

function reloadComments() {
    try {
        var comments = $("#comments-test-iframe, #gplus-signup-iframe-id, #sb-target, #yt-comments-sb, #watch-sidebar-live-chat, iframe[src*=error]");
        if (comments.length) {
            comments = comments.find("iframe").each(function () {
                var split = this.src.split("?");
                var oldsrc = split[0] + "?r=2&" + split[1];
                this.src = oldsrc;
            });
        } else {
            if (comments.tagName && comments.tagName == 'IFRAME') {
                var split = comments.getAttribute('src').split("?");
                var oldsrc = split[0] + "?r=2&" + split[1];
                comments.setAttribute('src', oldsrc);
            }
        }
    } catch (e) {}
}

function getVideoSize() {
    return GM_getValue("vidsize", "1") == "1";
}

function setVideoSize(val) {
    return  GM_setValue("vidsize", (video = val) ? "1" : "0");
}

function getTheme() {
    return GM_getValue("theme", "Switch")
}

function setTheme(val) {
    GM_setValue("theme", theme = val);
}

function isErrorTopPage() {
  var iframes = $('body iframe');
  if (iframes.length) {
    for (var i = 0; i < iframes; i++) {
      if (isErrorUrl(iframes[i].getAttribute('src'))) {
        return true;
      }
    }
  }
  if (iframes.getAttribute) {
    return isErrorUrl(iframes.getAttribute('src'));
  }
  return false;
}

function isSettingsUrl(url) {
    return url.split('?')[0].split('/').reverse()[0] == 'account';
}

function isErrorUrl(url) {
    return url.split('?')[0].split('/').reverse()[0] == 'error';
}

function createButton(mode) {
    var result = document.createElement("button");
    result.setAttribute("role", "button");
    result.setAttribute("type", "button");
    result.setAttribute("class", (mode ? "dark-theme-button " : "") + "yt-uix-button yt-uix-button-primary yt-uix-button-size-default");
    return result;
}

function expand(prefixes, rule) {
    prefixes.push('');
    return prefixes.join(' ' + rule + '\n');
}

var INTERMEDIATE_CSS = "* {transition: filter linear 0.4s, background-color linear 0.4s, color linear 0.4s, border linear 0.4s, box-shadow linear 0.4s !important;}";

function removeCss(name) {
    var transitionFix = makeStyle("transition_fix", INTERMEDIATE_CSS);
    $('style[name="darkYouTube_' + name + '"]').remove();
    setTimeout(function() {
        transitionFix.parentNode.removeChild(transitionFix);
    }, 500);
}

function addCss(name, sheet) {
    var transitionFix = makeStyle("transition_fix", INTERMEDIATE_CSS);
    makeStyle(name, sheet);
    setTimeout(function() {
        transitionFix.parentNode.removeChild(transitionFix);
    }, 500);
}

function makeStyle(name, sheet) {
    var result = document.createElement("style");
    result.setAttribute("type", "text/css");
    result.setAttribute("name", "darkYouTube_" + name);
    result.innerHTML = sheet;
    document.head.appendChild(result);
    return result;
}

function RunScript(func, mustCall, params) {
  var scr = document.createElement('SCRIPT');
  if (mustCall) {
    if (params) {
      var pars = [];
      for (var i = 2; i < arguments.length; i++) {
        pars.push(arguments[i]);
      }
      scr.innerHTML = '(' + func.toString() + ').apply(this, ' + JSON.stringify(pars) + ');';
    } else {
      scr.innerHTML = '(' + func.toString() + ')();';
    }
  } else {
    scr.innerHTML = func.toString();
  }
  document.body.appendChild(scr);
  scr.parentNode.removeChild(scr);
};